;; @@
(defn- cache-pop-for-test
  "reset information of the oldest date"
  []
  (let [date (.poll cache-queue)]
    (reset! (nth (get data-cache date) 0) nil)
    (reset! (nth (get data-cache date) 1) nil)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;clojure-backtesting.demo/cache-pop-for-test</span>","value":"#'clojure-backtesting.demo/cache-pop-for-test"}
;; <=

;; @@
(defn- cache-add-info-for-test
  [date info]
  (while (>= (.size cache-queue) CACHE-SIZE) (cache-pop-for-test))
  (.add cache-queue date)
  (reset! (nth (get data-cache date) 0) info))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;clojure-backtesting.demo/cache-add-info-for-test</span>","value":"#'clojure-backtesting.demo/cache-add-info-for-test"}
;; <=

;; @@
(defn get-info-by-date-for-test
  "Get the full tics info.\n
   Returns a vector of maps."
  ;; to do join the compustat
  [date]
  (if-let [file (get data-files date)]
    (if-let [ret (deref (nth (get data-cache date) 0))]
      ;; cache hit
      ret
      ;; cache miss
      (let [data (line-seq (io/reader file))
            data (map read-string data)
            data (map zipmap (repeat headers) data)
            data (if headers2 (merge-data data date) data)]
        (cache-add-info-for-test date data)))
    nil))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;clojure-backtesting.demo/get-info-by-date-for-test</span>","value":"#'clojure-backtesting.demo/get-info-by-date-for-test"}
;; <=

;; @@
(defn get-set-roe [date]
  (let [data (get-info-by-date-for-test date)]
    (loop [remaining data
           result-set []
           ROE-list []]
      (if (empty? remaining)
        {:data result-set :ROE-set ROE-list}
        (let [firstline (first remaining)
              next-remaining (rest remaining)
              [year month day] (map parse-int (str/split (get firstline :DATE) #"-"))]
          (if (and (contains? firstline :niq) (contains? firstline :cshoq) (not (empty? (get firstline :niq))) (not (empty? (get firstline :cshoq))))
            (let [niq (Double/parseDouble (get firstline :niq))
                  cshoq (Double/parseDouble (get firstline :cshoq))
                  PRC (get firstline :PRC)
                  ROE (/ niq (* PRC cshoq))]
              (recur next-remaining (conj result-set {:PERMNO (get firstline :PERMNO) :year year :ROE ROE}) (conj ROE-list ROE)))
            (recur next-remaining result-set ROE-list)))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;clojure-backtesting.demo/get-set-roe</span>","value":"#'clojure-backtesting.demo/get-set-roe"}
;; <=

;; @@
;;demo 
(def data-demo (get-set-roe "1980-12-18"))
(println data-demo)
